//ng-bootstrap.github.io/#/components/tooltip/examples"\n                                          target="_blank">ngbTooltip Direktive von ng-bootstrap</a>.<br>\n\n      Popover realisieren wir mit der <a class="external"\n                                          href="https://ng-bootstrap.github.io/#/components/popover/examples"\n                                          target="_blank">ngbPopover Direktive von ng-bootstrap</a>.\n    </p>\n  </div>\n</div>\n\n<h2 class="mt-5">Tooltip auf Icon-Buttons</h2>\n<p>Kommt bei Icon-Buttons ohne Text zum Einsatz. Wenn gen\xfcgend Platz vorhanden ist, soll der Tooltip unterhalb des\n  Icon-Buttons angezeigt werden.</p>\n\n<app-code-example src="ui-elements/tooltips/tooltips.component.html#button">\n  <button type="button" class="btn btn-outline-primary mr-2" placement="bottom" ngbTooltip="Einstellungen">\n    <span class="fas fa-cog fa-fw"></span>\n  </button>\n  <button type="button" class="btn btn-outline-primary" placement="bottom" ngbTooltip="Dokument bearbeiten">\n    <span class="fas fa-pen fa-fw"></span>\n  </button>\n</app-code-example>\n\n<h2 class="mt-5">Tooltip in Kombination mit einem Icon</h2>\n<p>\n  Wird meist f\xfcr Hilfestellungen oder Zusatzinformationen verwendet. Das Icon wird rechts vom Eingabefeld oder Text\n  platziert.\n  Dieser Tooltip sollte immer mit einem Klick getriggert werden, da Mouseover in mobilen Applikationen nicht\n  funktioniert.\n</p>\n\n<app-code-example src="ui-elements/tooltips/tooltips.component.html#icon">\n  <div class="d-flex align-items-center">\n    Steuerrechtlicher Wohnsitz &nbsp;\n    <span class="fas fa-info-circle text-info mr-2" style="font-size: 2rem" triggers="click:click"\n          ngbTooltip="Der Ort, wo sich eine Person mit der Absicht dauernden Verbleibens aufh\xe4lt."></span>\n  </div>\n</app-code-example>\n\n<h2 class="mt-5">Inline Tooltip</h2>\n<p>\n  Ein Inline Tooltip erkl\xe4rt einen Begriff, der im Text vorkommt. Kann bei erkl\xe4rungsbed\xfcrftigen Texten im Fliesstext eingesetzt werden.\n  Das Wort ist visuell hervorzuheben und muss sich von einem Link klar unterscheiden.\n</p>\n\n<app-code-example src="ui-elements/tooltips/tooltips.component.html#inline">\n  <p>\n    Lorem ipsum dolor sit amet, consetetur sadipscing elitr,\n    <span class="border-bottom-dotted text-muted" ngbTooltip="dolor sit amet">sed diam nonumy</span>\n    eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua.\n  </p>\n</app-code-example>\n\n<h2 class="mt-5">Popover w\xe4hrend der Feldeingabe</h2>\n<p>Das Popover erscheint automatisch, sobald der Nutzer das Eingabefeld aktiviert. Beispielsweise bei Passwortvergabe\n  hilfreich.</p>\n\n<app-code-example src="ui-elements/tooltips/tooltips.component.html#inputfield">\n  <form>\n    <div class="form-row">\n      <div class="form-group col-md-4">\n        <label for="inputPassword2">Password</label>\n        <input type="password" class="form-control" id="inputPassword2" placeholder="Password"\n               popoverTitle="Mindestanforderungen"\n               placement="right"\n               autoClose="outside"\n               ngbPopover="Das Passwort muss mind. 8 Zeichen lang sein, Gross- und Kleinbuchstaben, eine Zahl und ein Sonderzeichen enthalten.">\n      </div>\n    </div>\n  </form>\n</app-code-example>\n\n<h2 class="mt-5">Popover f\xfcr zus\xe4tzliche Inhalte</h2>\n<p>Popovers k\xf6nnen im Gegensatz zu Tooltips viel mehr Text und auch einen Header enthalten, aber auch weitere\n  HTML-Elemente wie Bilder, Links oder Buttons.</p>\n\n<app-code-example src="ui-elements/tooltips/tooltips.component.html#popover">\n  <ng-template #popContent>\n    <p>In diesem Guide lernen Sie Schritt f\xfcr Schritt die wichtigsten Funktionen kennen:</p>\n    <ol>\n      <li>Steuererkl\xe4rung erfassen</li>\n      <li>Belege einreichen</li>\n      <li>Steuererkl\xe4rung freigeben</li>\n    </ol>\n    <div class="float-right">\n      <button type="button" class="btn btn-outline-primary mr-2 my-3" (click)="p.close()">\n        Weiter\n        <span class="fas fa-arrow-right ml-2"></span>\n      </button>\n    </div>\n  </ng-template>\n  <button type="button" class="btn btn-primary mr-2"\n          #p="ngbPopover"\n          triggers="manual"\n          (click)="p.toggle()"\n          placement="right"\n          [autoClose]="\'outside\'"\n          popoverTitle="Willkommen auf der Tour"\n          [ngbPopover]="popContent">\n    <span class="fas fa-play mr-3"></span>\n    Demo starten\n  </button>\n</app-code-example>\n'},HDdC:function(e,n,t){"use strict";t.d(n,"a",function(){return c});var i,r=t("7o/Q"),a=t("2QA8"),s=t("gRHU"),o=t("kJWO"),l=t("SpAZ"),u=t("2fFW"),c=((i=function(){function e(n){g(this,e),this._isScalar=!1,n&&(this._subscribe=n)}return b(e,[{key:"lift",value:function(n){var t=new e;return t.source=this,t.operator=n,t}},{key:"subscribe",value:function(e,n,t){var i=this.operator,o=function(e,n,t){if(e){if(e instanceof r.a)return e;if(e[a.a])return e[a.a]()}return e||n||t?new r.a(e,n,t):new r.a(s.a)}(e,n,t);if(o.add(i?i.call(o,this.source):this.source||u.a.useDeprecatedSynchronousErrorHandling&&!o.syncErrorThrowable?this._subscribe(o):this._trySubscribe(o)),u.a.useDeprecatedSynchronousErrorHandling&&o.syncErrorThrowable&&(o.syncErrorThrowable=!1,o.syncErrorThrown))throw o.syncErrorValue;return o}},{key:"_trySubscribe",value:function(e){try{return this._subscribe(e)}catch(n){u.a.useDeprecatedSynchronousErrorHandling&&(e.syncErrorThrown=!0,e.syncErrorValue=n),function(e){for(;e;){var n=e,t=n.closed,i=n.destination,a=n.isStopped;if(t||a)return!1;e=i&&i instanceof r.a?i:null}return!0}(e)?e.error(n):console.warn(n)}}},{key:"forEach",value:function(e,n){var t=this;return new(n=d(n))(function(n,i){var r;r=t.subscribe(function(n){try{e(n)}catch(t){i(t),r&&r.unsubscribe()}},i,n)})}},{key:"_subscribe",value:function(e){var n=this.source;return n&&n.subscribe(e)}},{key:o.a,value:function(){return this}},{key:"pipe",value:function(){for(var e=arguments.length,n=new Array(e),t=0;t<e;t++)n[t]=arguments[t];return 0===n.length?this:(0===(i=n).length?l.a:1===i.length?i[0]:function(e){return i.reduce(function(e,n){return n(e)},e)})(this);var i}},{key:"toPromise",value:function(e){var n=this;return new(e=d(e))(function(e,t){var i;n.subscribe(function(e){return i=e},function(e){return t(e)},function(){return e(i)})})}}]),e}()).create=function(e){return new i(e)},i);function d(e){if(e||(e=u.a.Promise||Promise),!e)throw new Error("no Promise impl found");return e}},HNSt:function(e,n,t){"use strict";t.r(n),n.default='<h1 class="mt-3 mb-4">Buttons</h1>\n\n<p class="lead">\n  Beim Klick auf einen Button, wird eine Aktion ausgel\xf6st.\n</p>\n\n<h2 class="mt-5">Wann und wie wird das Element eingesetzt?</h2>\n<ul>\n  <li>Immer, um eine Aktion auszul\xf6sen, zu wiederrufen oder abzubrechen.</li>\n  <li>\n    Schreibweise immer Grossbuchstabe und dann klein: "Speichern", "Abbrechen", "Suchen".<br>\n    Nie: "speichern" oder "SPEICHERN".\n  </li>\n  <li>Es ist zu unterscheiden zwischen:\n    <ol>\n      <li>\n        Prim\xe4re Aktion<br>\n        L\xf6st die Hauptaktion auf der Seite aus, wie "Speichern" oder "Erstellen".\n      </li>\n      <li>\n        Sekund\xe4re Aktion<br>\n        Aktionen, auf denen nicht der Fokus des Anwenders liegen soll, wie beispielsweise Abbrechen.\n      </li>\n    </ol>\n  </li>\n</ul>\n\n<h2 class="mt-5">Wann soll das Element nicht verwendet werden?</h2>\n<ul>\n  <li>\n    Buttons sind keine Navigationselemente. Wenn nur auf einen anderen Inhalt verlinkt wird, ohne\n    dass eine Aktion ausgel\xf6st wird, kommen Links zur Anwendung.\n  </li>\n  <li>\n    Button-Gruppen sollten grunds\xe4tzlich nicht im Contentbereich verwendet werden. Stattdessen soll\n    die\n    <a routerLink="/styleguide/layout/functionbar" class="highlight">Function Bar</a> verwendet\n    werden. Ausnahme: Wenn die Button-Gruppe nur einen Teilkontext des Contentbereichs betrifft.\n  </li>\n</ul>\n\n<h2 class="mt-5">Verwandte Elemente</h2>\n<ul class="related-elements">\n  <li><a routerLink="/styleguide/layout/functionbar" class="highlight">Function Bar</a></li>\n  <li><a routerLink="/styleguide/ui-elements/links" class="highlight">Links</a></li>\n  <li><a routerLink="/styleguide/ui-elements/badges" class="highlight">Badges</a></li>\n  <li><a routerLink="/styleguide/basics/icons" class="highlight">Icons</a></li>\n  <li><a routerLink="/styleguide/ui-elements/progress-indicators" class="highlight">Progress\n    Indicators</a></li>\n  <li><a routerLink="/styleguide/usability/tastaturbedienbarkeit" class="highlight">Tastaturbedienbarkeit</a>\n  </li>\n</ul>\n\n<div class="card mt-5">\n  <h2 class="card-header"><em class="fas fa-wrench mr-3"></em>Implementierung</h2>\n  <div class="card-body">\n    <p>\n      Buttons sind (mit Ausnahme der Badges) Default Bootstrap Komponenten und in der\n      <a class="external" href="https://getbootstrap.com/docs/4.5/components/buttons/"\n         target="_blank">Bootstrap\n        Dokumentation</a> ausf\xfchrlich dokumentiert.\n    </p>\n  </div>\n</div>\n\n<h2 class="mt-5">Button-Typen</h2>\n<p>\n  <strong>Primary Buttons</strong> (<code>btn-primary</code>) beschreiben die Hauptaktion des\n  jeweiligen Kontexts wie z.B. "Speichern" oder "Suchen" und werden mit <span\n  class="keyboard-key">Enter</span> ausgel\xf6st. Bei mehreren m\xf6glichen Aktionen ist der Primary\n  Button immer ganz rechts anzuordnen.<br>\n  Es soll nie mehr als ein Primary Button pro Seite verwendet werden. Falls ausnahmsweise doch\n  mehrere Primary Buttons auf einer Seite n\xf6tig sind, d\xfcrfen sie nicht nahe beieinander stehen und\n  es muss dem Benutzer immer klar ersichtlich sein, welchen der Buttons er mit <span\n  class="keyboard-key">Enter</span> ausl\xf6sen wird.\n</p>\n<p>\n  F\xfcr alle anderen Aktionen werden <strong>Standard Buttons</strong>\n  (<code>btn-outline-primary</code>) verwendet. Um die Arbeit zu erleichtern und den Code lesbarer\n  zu machen, werden Buttons mit der <code>btn</code> Klasse automatisch als <code>btn-outline-primary</code>\n  gerendert.\n</p>\n\n<app-code-example src="ui-elements/buttons/buttons.component.html#primary-secondary">\n  <button type="button" class="btn btn-outline-primary mr-2">Abbrechen</button>\n  <button type="button" class="btn btn-primary">Speichern</button>\n</app-code-example>\n\n<h2 class="mt-5">Button-Gruppen</h2>\n<p>\n  Button-Gruppen sind n\xfctzlich um Buttons zusammenzufassen, die eine Beziehung miteinander haben.\n  Die Buttons sollen logisch nach Verwendungsh\xe4ufigkeit und Wichtigkeit in Gruppen aufgeteilt\n  werden.<br>\n  Horizontale Button-Gruppen sollen nur unterhalb von Formularen verwendet werden und nicht mehr als\n  ein mal pro\n  Seite.<br>\n\n  Alle Buttons in einer Gruppe sollten in der Regel gleich breit sein, dies trifft auch auf\n  horizontale Gruppen zu.\n  <a routerLink="/styleguide/layout/grid" class="highlight">Grid</a>\n</p>\n<app-code-example src="ui-elements/buttons/buttons.component.html#button-group">\n  <p>Vertikale Button-Gruppe in einem Block</p>\n  <div class="btn-group-vertical">\n    <button type="button" class="btn btn-outline-primary">Auf Grundbuch anmelden</button>\n    <button type="button" class="btn btn-outline-primary">Notiz erfassen</button>\n    <button type="button" class="btn btn-outline-primary">Stornieren</button>\n  </div>\n\n  <p class="mt-3">Vertikale Button-Gruppe mit Grid</p>\n  <div class="row">\n    <div class="col-sm-3">\n      <button type="button" class="btn btn-outline-primary w-100 mb-2">Bearbeiten</button>\n      <button type="button" class="btn btn-outline-primary w-100 mb-2">L\xf6schen</button>\n      <button type="button" class="btn btn-outline-primary w-100 mb-2">Zur\xfcck zur \xdcbersicht\n      </button>\n      <button type="button" class="btn btn-primary w-100 mb-2">Publizieren</button>\n    </div>\n  </div>\n\n  <p class="mt-3">Horizontale Button-Gruppe mit Grid</p>\n  <div class="row">\n    <div class="col-md-8 d-flex">\n      <button type="button" class="btn btn-outline-primary w-100 mr-2">Abbrechen</button>\n      <button type="button" class="btn btn-outline-primary w-100 mr-2">Vorlage speichern</button>\n      <button type="button" class="btn btn-primary w-100 mr-2">Speichern</button>\n    </div>\n  </div>\n</app-code-example>\n\n\n<h2 class="mt-5">In Input-Groups</h2>\n<p>\n  Wenn wir mit <code>input-group</code> Buttons an ein <code>&lt;input></code> "kleben" verwenden\n  wir weisse Buttons:\n</p>\n<app-code-example src="ui-elements/buttons/buttons.component.html#inputGroup">\n  <div class="form-inline">\n    <div class="input-group">\n      <input type="text" class="form-control" id="search" [(ngModel)]="exampleText"\n             placeholder="Suchen">\n      <div class="input-group-append">\n        <button class="btn btn-light" type="button" (click)="deleteExampleText()">\n          <span class="fas fa-search"></span>\n        </button>\n      </div>\n    </div>\n  </div>\n</app-code-example>\n\n<h2 id="icon-buttons" class="mt-5">Button mit Icon</h2>\n<p>\n  Das Textlabel ist das wichtigste Element auf einem Button, denn es kommuniziert die Aktion, die\n  ausgef\xfchrt wird.<br>\n  Wenn immer m\xf6glich sollen deshalb Buttons mit einem Textlabel verwendet werden.<br>\n  Buttons mit Icons k\xf6nnen ganz einfach mit Hilfe von Font Awesome erstellt werden.<a\n  routerLink="/styleguide/basics/icons" class="highlight">Icons</a><br>\n  Dabei sollen die Icons aus dem Bedag Standard Icon Set bevorzugt verwendet werden, damit unsere\n  Applikationen ein einheitliches\n  Look & Feel aufweisen.\n\n</p>\n<h3>Icon Buttons mit Text</h3>\n<p>\n  Icon Buttons mit Text k\xf6nnen hilfreich sein, um visuelles Interesse zu generieren.\n  Icon Buttons lenken die Aufmerksamkeit des Benutzers verst\xe4rkt auf den Button und sollten deshalb\n  nur verwendet werden, wenn dies erw\xfcnscht ist.<br>\n  Das Icon soll immer links vom Text platziert werden, ausser bei Richtungsangaben oder\n  weiterf\xfchrenden Aktionen.\n</p>\n<h3>Icon Buttons ohne Text</h3>\n<p>\n  Icon Buttons ohne Text sollten nur sp\xe4rlich verwendet werden. Sie sind sinnvoll, wenn die\n  Bedeutung des Icons f\xfcr die grosse Mehrheit der Anwender sonnenklar ist und zus\xe4tzlicher Text eher\n  verwirren w\xfcrde. Gute Beispiele sind:\n  Hamburgermenu, Fett/Kursiv/Unterstrichen im Editor, Play/Pause f\xfcr Batch-Jobs.<br>\n  Bei Icon-Buttons ohne Text wird die Button-Breite mit "fa-fw" fixiert, sodass alle Buttons gleich\n  breit sind. Zudem muss bei textlosen Buttons ein <a routerLink="/styleguide/ui-elements/tooltips"\n                                                      class="highlight">Tooltip</a>\n  vorhanden sein.<br>\n</p>\n\n<div class="alert alert-warning d-flex align-items-center p-3 text-dark my-5">\n  <span class="fas fa-info-circle fa-2x text-info mr-4"></span>\n  <div>\n    F\xfcr mobile Applikationen m\xfcssen Icon-Buttons eine Mindestgr\xf6sse haben, dies kann mit <code>btn-lg</code>\n    f\xfcr kleine Viewport-Sizes erreicht werden.\n  </div>\n</div>\n\n<app-code-example src="ui-elements/buttons/buttons.component.html#icons">\n  <button type="button" class="btn btn-outline-primary mr-2" ngbTooltip="L\xf6schen">\n    <span class="fas fa-trash-alt fa-fw"></span>\n  </button>\n  <button type="button" class="btn btn-outline-primary mr-2" ngbTooltip="Drucken">\n    <span class="fas fa-print fa-fw"></span>\n  </button>\n  <button type="button" class="btn btn-outline-primary mr-2" ngbTooltip="Batchjob anhalten">\n    <span class="fas fa-pause fa-fw"></span>\n  </button>\n  <button type="button" class="btn btn-outline-primary mr-2">\n    <span class="fas fa-envelope mr-2"></span>Newsletter abonnieren\n  </button>\n  <button type="button" class="btn btn-outline-primary mr-2">Weiter\n    <span class="fas fa-arrow-right ml-2"></span>\n  </button>\n  <button type="button" class="btn btn-primary">\n    <span class="fas fa-check mr-2"></span>Freigeben\n  </button>\n</app-code-example>\n\n<h2 class="mt-5">Buttons mit Badge</h2>\n<p>Buttons k\xf6nnen mit der Klasse <code>btn-with-badge</code> mit einem\n  <a routerLink="/styleguide/ui-elements/badges" class="highlight">Badge</a> versehen werden\n</p>\n\n<app-code-example src="ui-elements/buttons/buttons.component.html#badge">\n  <button type="button" class="btn btn-outline-primary btn-with-badge mr-4">\n    Warnungen anzeigen<span class="badge badge-pill badge-dark">15</span>\n  </button>\n</app-code-example>\n'},HUkj:function(e,n,t){"use strict";t.r(n),n.default="import {Component} from '@angular/core';\nimport {IconToggleService} from './icon-toggle.service';\n\n@Component({\n  selector: 'app-nav',\n  templateUrl: './app-nav.component.html'\n})\nexport class AppNavComponent {\n  constructor(public toggler: IconToggleService) {\n  }\n}\n"},HW7T:function(e,n,t){"use strict";t.r(n),n.default='<h1 class="mt-3 mb-4">Action Bar</h1>\n\n<p class="lead">\n  Die Action Bar enth\xe4lt die Buttons f\xfcr die Funktionen, welche der Benutzer erst nach Verwendung\n  der Ansicht ausl\xf6sen\n  will, wie "L\xf6schen" oder "Speichern", und die sich auf den gesamten Contentbereich beziehen.\n</p>\n\n<h2>Wann und wie wird das Element eingesetzt?</h2>\n<ul>\n  <li>Die Action Bar befindet sich immer am unteren Seitenrand.</li>\n  <li>Sie bietet nur Aktionen, welche <em>nach</em> Verwendung der Ansicht gebraucht werden.</li>\n  <li>\n    Es darf nur ein Primary Button verwendet werden und dieser ist rechts zu platzieren (siehe <a\n    routerLink="/styleguide/ui-elements/buttons" class="highlight">Buttons</a>).\n  </li>\n  <li>\n    Sie wird verwendet, wenn der Inhalt auf dem zu erwartendem Eingabeger\xe4t mindestens knapp die\n    ganze Seite\n    einnimmt.<br>\n    Sofern nicht explizit anders definiert, gehen wir davon aus, dass Fachapplikationenen auf einem\n    24"-Bildschirm\n    benutzt werden.\n  </li>\n</ul>\n\n<h2 class="mt-5">Wann soll das Element nicht verwendet werden?</h2>\n<ul class="mb-5">\n  <li>\n    Die Action Bar soll nicht verwendet werden, wenn dadurch die\n    <a routerLink="/styleguide/usability/mauswege" class="highlight">Mauswege</a> zu gross werden.\n  </li>\n  <li>\n    Wenn der Inhalt der Maske im Normalfall nicht den ganzen Bildschirm einnimmt, werden die\n    Aktionen direkt unterhalb\n    des Inhalts dargestellt.<br>\n    Insbesondere bei der Suche soll der Suchen-Button direkt unter dem Formular und oberhalb des\n    Resultatebereichs\n    angezeigt werden.\n  </li>\n</ul>\n\n<h2 class="mt-5">Verwandte Elemente</h2>\n<ul class="related-elements mb-5">\n  <li><a routerLink="/styleguide/layout">Layout</a></li>\n  <li><a routerLink="/styleguide/ui-elements/buttons">Buttons</a></li>\n  <li><a routerLink="/styleguide/ui-elements/forms/large-form-example" class="highlight">Large Form\n    Example</a></li>\n  <li><a routerLink="/styleguide/usability/mauswege">Mauswege</a></li>\n  <li><a routerLink="/styleguide/layout/functionbar">Function Bar</a></li>\n</ul>\n\n<app-code-example src="layout/actionbar/actionbar-demo.component.html#basic">\n  Siehe unten ...\n  <div id="actionbar">\n    <button class="btn btn-outline-primary mr-2">Abbrechen</button>\n    <button class="btn btn-primary">Speichern</button>\n  </div>\n</app-code-example>\n\n<p class="mt-5">\n  Abst\xe4nde zwischen den Buttons k\xf6nnen mit den\n  <a href="https://getbootstrap.com/docs/4.5/utilities/spacing/">margin-utilities von Bootstrap</a>\n  kontrolliert werden.\n</p>\n'},I2WV:function(e,n,t){"use strict";t.r(n),n.default='<h1 class="mt-3 mb-4">Navigation</h1>\n\n<p class="lead">\n  Die Navigation enth\xe4lt die zentralen Menupunkte der Applikation. Sie organisiert Inhalte und\n  Funktionen der Anwendung\n  auf bis zu 3 Hierarchiestufen.\n</p>\n\n<h2>Wann und wie wird das Element eingesetzt?</h2>\n<ul>\n  <li>Sie ist immer links angeordnet.</li>\n  <li>Sie kann mit dem Hamburger-Icon im Header auf- und zugeklappt werden.</li>\n  <li>Sind Unternavigationspunkte vorhanden, werden diese mit einem Pfeil nach rechts\n    ausgezeichnet.\n  </li>\n  <li>Wenn keine sinnvollen Icons vorhanden sind, ist es besser auf Icons zu verzichten.</li>\n  <li>\n    Globale Systemeinstellungen f\xfcr Administratoren sind an unterster Stelle zu platzieren, falls\n    vorhanden.\n    <br>\n    Systemeinstellungen, die nur den eingeloggten Benutzer betreffen, sind im Benutzermenu im\n    <a class="highlight" routerLink="/styleguide/layout/header">Header </a> zu platzieren.\n  </li>\n  <li>\n    Informationen ("About", "Hilfe" etc.) geh\xf6ren nicht ins Navigationsmenu, sondern in\n    das Hilfe-Menu im<a class="highlight" routerLink="/styleguide/layout/header">Header</a>.\n  </li>\n  <li>Wenn viel Platz im Inhaltsbereich gebraucht wird, kann die Navigation im zugeklappten\n    Zustand auf Icons reduziert werden.\n  </li>\n</ul>\n\n<div class="alert alert-warning d-flex align-items-center p-3 text-dark mt-5">\n  <span class="fas fa-info-circle fa-2x text-info mr-4"></span>\n  <div>\n    Die URL-Struktur der Anwendung sollte mit der Hierarchie der Main Navigation immer\n    \xfcbereinstimmen. Siehe URL dieser Seite als Beispiel:\n    <code>...{{this.router.url}}</code>\n  </div>\n</div>\n\n<h2 class="mt-5">Wann soll das Element nicht verwendet werden?</h2>\n<ul>\n  <li>Auf besonderen Seiten wie z.B. separate Einstiegsseiten oder \xf6ffentliche Dashboards.</li>\n</ul>\n\n<h2 class="mt-5">Verwandte Elemente</h2>\n<ul class="related-elements">\n  <li>\n    <a routerLink="/styleguide/layout">Layout</a>\n  </li>\n  <li>\n    <a routerLink="/styleguide/basics/icons">Icons</a>\n  </li>\n  <li>\n    <a routerLink="/styleguide/ui-elements/links">Links</a>\n  </li>\n  <li>\n    <a routerLink="/styleguide/layout/header">Header</a>\n  </li>\n  <li>\n    <a routerLink="/styleguide/layout/breadcrumbs">Breadcrumbs</a>\n  </li>\n</ul>\n\n<div class="card my-5">\n  <h2 class="card-header"><em class="fas fa-wrench mr-3"></em>Implementierung\n  </h2>\n  <div class="card-body">\n    <p>\n      Die\n      <code>app-nav-menu</code>\n      Komponente dient als Container f\xfcr die Navigation und k\xfcmmert\n      sich um allgemeine\n      Funktionen\n      wie das Ein- und Ausblenden. Mit dem Attribut <code>startExpanded</code> kann ein Untermenu\n      bereits beim Laden der Seite aufgeklappt werden.\n    </p>\n\n    <p>\n      Die <code>app-nav-item</code> Komponente beschreibt einen einzelnen Eintrag in der Navigation,\n      wobei die Hierarchie durch Verschachtelung beschrieben wird. Sie akzeptiert folgende Inputs:\n    </p>\n\n    <table>\n      <tr>\n        <td class="font-weight-bold pr-3">icon</td>\n        <td>CSS-Klassenname des Fontawesome-Icons</td>\n      </tr>\n      <tr>\n        <td class="font-weight-bold pr-3">labelKey</td>\n        <td>Translation-Key f\xfcr das Label</td>\n      </tr>\n      <tr>\n        <td class="font-weight-bold pr-3">tooltipKey</td>\n        <td>Translation-Key f\xfcr den Tooltip (falls nicht angegeben, wird kein Tooltip angezeigt)\n        </td>\n      </tr>\n      <tr>\n        <td class="font-weight-bold pr-3">url</td>\n        <td>Die interne URL, zu der navigiert werden soll</td>\n      </tr>\n      <tr>\n        <td class="font-weight-bold pr-3">href</td>\n        <td>Die externe URL, zu der navigiert werden soll</td>\n      </tr>\n      <tr>\n        <td class="font-weight-bold pr-3">target</td>\n        <td>\n          Definiert in welchem Fenster bzw. Tab der Link ge\xf6ffnet werden soll. Entspricht dem\n          <a class="external"\n             href="https://html.spec.whatwg.org/multipage/text-level-semantics.html#the-a-element"\n             target="_blank">"target" Attribut in\n            HTML</a>.\n        </td>\n      </tr>\n    </table>\n\n  </div>\n</div>\n\n<app-code-example src="../app-nav.component.html">\n  <p>\n    Navigationsmenu des Bedag Styleguides\n  </p>\n  <p>\n    Hinweis: Der Toggler wurde zu Demonstrationszwecken implementiert - in einer normalen\n    Applikation sollte man sich\n    auf eine Variante festlegen.\n  </p>\n  <button type="button" class="btn btn-outline-primary"\n          (click)="toggler.showIcons = !toggler.showIcons">\n    {{toggler.showIcons ? \'Zeige Navigation ohne Icons\' : \'Zeige Navigation mit Icons\'}}\n  </button>\n</app-code-example>\n\n<h2 class="mt-5">Navigation im zugeklappten Zustand auf Icons reduzieren</h2>\n<p>\n  Wenn die Navigation zugeklappt wird, verschwindet sie vollst\xe4ndig.\n  <br>\n  F\xfcr gewisse Applikationen, bei denen viel Raum im Inhaltsbereich gebraucht wird, kann es von\n  Vorteil sein, wenn die Navigation stattdessen auf Icons reduziert wird. Sie nimmt dadurch weniger\n  Platz in Anspruch, bleibt aber immer noch bedienbar. F\xfcr Mobile-Applikationen ist diese Variante\n  eher nicht geeignet.\n  <br>\n  Im <a href="https://confluence.se.bedag.ch/x/IIFaBg" class="external"\n        target="_blank">Notariat+</a>\n  wurde diese Variante der Styleguide-Navigation umgesetzt und kann als Beispiel verwendet werden.\n  <a class="external" target="_blank"\n     href="https://stash.se.bedag.ch/projects/RAUM-CAPI/repos/capitastra-parent/browse/capitastra-client/src/app/core/extension/navigation?at=refs%2Fheads%2Ffeature%2Fnotariat-plus-development">\n    Die Implementierung kann auf dem Bitbucket Server nachgeschlagen werden.\n  </a>\n  <br>\n</p>\n'},I55L:function(e,n,t){"use strict";t.d(n,"a",function(){return i});var i=function(e){return e&&"number"==typeof e.length&&"function"!=typeof e}},I9Ie:function(e,n,t){"use strict";t.r(n),n.default='<h1 class="mt-3 mb-4">Dividers</h1>\n\n<p class="lead">\n  Dividers gruppieren Inhalte\n</p>\n\n<h2 class="mt-5">Wann und wie wird das Element eingesetzt?</h2>\n<ul>\n  <li>Wenn Inhalte in mentale Einheiten gruppiert werden sollen, um dem Nutzer mehr Struktur und Orientierung\n    zu bieten. Mentale Einheiten sind z.B. Lieferadresse, Rechnungsadresse, Zahlungsmodalit\xe4ten, etc.\n  </li>\n</ul>\n\n<h2 class="mt-5">Wann soll das Element nicht verwendet werden?</h2>\n<ul class="mb-5">\n  <li>Wenn nach Titeln eine Tabelle folgt.</li>\n</ul>\n\n<h2 class="mt-5">Verwandte Elemente</h2>\n<ul class="related-elements mb-5">\n  <li><a routerLink="/styleguide/basics/typography" class="highlight">Typographie</a></li>\n  <li><a routerLink="/styleguide/ui-elements/forms" class="highlight">Forms</a></li>\n</ul>\n\n<app-code-example src="ui-elements/dividers/dividers.component.html#de">\n  <h2 class="title-divider">Title Divider</h2>\n  <br>\n  Standard HTML-Divider:\n  <hr>\n</app-code-example>\n'},IClr:function(e,n,t){"use strict";t.r(n),n.default='<h1 class="mt-3 mb-4">Bedag Angular Styleguide</h1>\n\n<p class="lead">\n  Der Styleguide bildet die Grundlage f\xfcr die Frontend-Entwicklung neuer Webapplikationen der Bedag.\n  Er unterst\xfctzt dich\n  mit vielen Beispielen und Hilfestellungen bei der Entwicklung der User Interfaces.\n</p>\n\n<p>\n  Alle Elemente bauen auf Bootstrap und Angular auf. Die Elemente im Styleguide k\xf6nnen direkt durch\n  Kopieren der Code Samples eingesetzt werden. Alles was von Bootstrap abweicht, wird automatisch\n  \xfcberschrieben.\n</p>\n\n<h2 class="mt-5">Versionen</h2>\n<p>Der Styleguide basiert auf folgenden Versionen:</p>\n<div class="container-fluid">\n  <dl class="row">\n    <dt class="col-2">Angular</dt>\n    <dd class="col-10"><strong>{{version[\'@angular/core\']}}</strong></dd>\n    <dt class="col-2">Bootstrap</dt>\n    <dd class="col-10"><strong>{{version[\'bootstrap\']}}</strong></dd>\n    <dt class="col-2">NG Bootstrap</dt>\n    <dd class="col-10"><strong>{{version[\'@ng-bootstrap/ng-bootstrap\']}}</strong></dd>\n  </dl>\n</div>\n\n<h2 class="mt-5">Getting Started</h2>\n\n<p>\n  Um die Code-Beispiele mit Copy-Paste einsetzen zu k\xf6nnen, braucht es nur einige CSS-Dateien und\n  ein paar kleine Typescript-Komponenten.<br>\n  Im Confluence befindet sich eine <a class="external"\n                                      href="https://confluence.se.bedag.ch/display/ENGINEERING/Bedag+Angular+Styleguide"\n                                      target="_blank">Anleitung f\xfcr\n  den Einbau in bestehende oder neue Projekte</a>.\n</p>\n\n<h2 class="mt-5">Was bietet der Styleguide?</h2>\n\n<ul>\n  <li>\n    Ein <a class="highlight" routerLink="/styleguide/layout">Layout-Ger\xfcst</a> f\xfcr Responsive\n    Web-Applikationen, die\n    sowohl auf dem Desktop als auch auf dem Tablet oder Smartphone gut bedienbar sind.\n  </li>\n  <li>Vorlagen und Code-Beispiele, die die Arbeit am Frontend erleichtern.</li>\n  <li>User Experience Design Guidelines, mit denen die Benutzerf\xfchrung optimiert und f\xfcr jeden\n    Kontext das richtige GUI-Element identifiziert werden kann.\n  </li>\n</ul>\n<p>\n  Unsere Applikationen werden dank benutzerfreundlicher GUIs qualitativ hochwertiger und f\xfcr die\n  Kunden intuitiver und effizienter bedienbar.<br>\n\n<h2 class="mt-5">Was bietet der Styleguide (noch) nicht?</h2>\n\n<ul>\n  <li>\n    <strong>Internationalisierung:</strong> da verschiedene Varianten von i18n eingesetzt werden,\n    wurde diese in den\n    meisten Beispielen weggelassen, um diese lesbarer zu machen. In den wenigen Beispielen, die i18n\n    implementieren, wurde <a class="external" href="http://www.ngx-translate.com/" target="_blank">ngx-translate</a>\n    eingesetzt.\n  </li>\n  <li>\n    <strong>Accessibility:</strong> Projekte haben unterschiedliche Anforderungen betreffend\n    Accessibility. Der\n    Styleguide und die Codebeispiele enthalten Basisinformationen f\xfcr die wichtigsten Bereiche, aber\n    f\xfcr Projekte mit hohen Anforderungen an die Barrierefreiheit reicht dies noch nicht aus. Wir\n    empfehlen als weiterf\xfchrende Informationsquellen den\n    <a class="external" href="https://www.accessibility-developer-guide.com/" target="_blank">Accessibility\n      Developer\n      Guide</a>, sowie die\n    <a class="external" href="https://www.w3.org/WAI/" target="_blank">Web Accessibility Initiative\n      (WAI)</a> des W3C.\n  </li>\n  <li>\n    <strong>Web Design f\xfcr Internetauftritte:</strong> Der Styleguide ist auf das Design von\n    Fachapplikationen ausgerichtet. F\xfcr \xf6ffentlich zug\xe4ngliche Internetauftritte gelten in vielen\n    Bereichen andere Designgrunds\xe4tze als f\xfcr Fachapplikationen.\n  </li>\n</ul>\n\n<h2 class="mt-5">Andere Styleguides</h2>\n<div class="container-fluid">\n  <dl class="row">\n    <dt class="col-2">Bedag Brand</dt>\n    <dd class="col-10">\n      <a class="external"\n         href="https://www.cd.sites.be.ch/document/63"\n         target="_blank">Einstiegsseite</a> -\n      <a class="external" href="https://www.cd.sites.be.ch/document/54#/basics/farbwelt"\n         target="_blank">Farb-Schemas</a> (User: communications@bedag.ch / PW: seecdmanual)\n    </dd>\n    <dt class="col-2">Kanton Bern</dt>\n    <dd class="col-10">\n      <a class="external"\n         href="https://www.cd.sites.be.ch/d/mLaezX2xseW6/anwendungen#/web-mobile/web-applikationen"\n         target="_blank">Einstiegsseite</a> -\n      <a class="external" href="https://www.be.ch/web-styleguide"\n         target="_blank">Styleguide</a> (User: guest / PW: kantonbern)\n    </dd>\n    <dt class="col-2">Bund</dt>\n    <dd class="col-10">\n      <a class="external" href="https://swiss.github.io/styleguide/de/"\n         target="_blank">Einstiegsseite</a> -\n      <a class="external" href="https://github.com/swiss/styleguide"\n         target="_blank">Git-Repository</a>\n    </dd>\n  </dl>\n</div>\n<h2 class="mt-5">Fragen oder Erg\xe4nzungen?</h2>\n<div class="container-fluid mt-3">\n  <div class="row mb-3">\n    <div class="col-md-2">\n      <a target="_blank" href="https://teams.microsoft.com/l/channel/19%3afbc7b6bb05804273a1cae1c741c097f6%40thread.skype/IBS%2520GUI%2520Entwicklung\n?groupId=8bb72eea-4e26-499b-be1b-871bca7b411d&tenantId=5aa867eb-55db-4b2c-a9c9-3d6c94c46894"><img\n        class="img-fluid"\n        style="max-width: 4em"\n        alt="Microsoft Teams" src="assets/ms-tea